description:
The theme for this year&amp;#039;s 29th parade was &quot;I Believe&quot; with various sections of the parade demonstrating belief in all aspects of Queer culture and sub-culture. One float, that grabbed the crowd&amp;#039;s attention was the Brokeback Mormons, a parody on the US state of Utah banning the movie Brokeback Mountain.

Highlights from Maynard ABC Australia.

